              <a href="#home">My Brand</a>
            </Navbar.Brand>
          </Navbar.Header>
          <Nav>
            <NavItem href="#">
              Home
            </NavItem>
            <NavItem href="#">
              Post
            </NavItem>
          </Nav>
        </Navbar>
        </Navbar>
        MyNavbar
				<h1>Upcoming Events</h1>
				<Menu places={this.state.places} />

			</div>
		);
	}
}

export default App;
